// make sure user decides if they want to add name to the project or not

const Project = ({navigate}) => {
    const project = JSON.parse(window.localStorage.getItem("project")) // this is response.data

    if (project) {
        const title = project.data.title
    const description = project.data.description
    const technologies = Object.keys(project.data.technologies).map(key => <li key={key}>{project.data.technologies[key]}</li>)
    const resources = Object.keys(project.data.resources).map(key => <li key={key}><a href={project.data.resources[key]['link']} target='_blank' rel="noreferrer">{project.data.resources[key]["title"]}</a> </li>)

        return (

            <div className="project-container">
                <h1>{project.data.title}</h1>
                <div className="description-container">
                    <p>{description}</p>
                </div>

                <h3>Technologies:</h3>
                <div className="technologies-container">
                    <p>{technologies}</p>
                </div>

                <h3>Resources:</h3>
                <div className="resources-container">
                    <p>{resources}</p>
                </div>

                <p>by {project.author}</p>
            </div>
            )} else {
                return (
                    <p>loading ...</p>
                )
            }
} 

export default Project
